Java SE Programming: JDBC, Reflections, and Threading
with Gene Van Sant

Course Description: This course teaches how to develop more advanced Java SE applications using Eclipse. Students will be introduced to Java Beans and Java Database Connectivity (JDBC). Students will learn about internationalizing their Java applications, using Java reflection, multi-tier architecture, using threads for multitasking, and networking.

Prerequisites: This course is intended for programmers who are familiar with Java and want to learn about the advanced features of Java. Students should have a good understanding object-oriented programming using Java.
